import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button, Form, FormGroup, Label, Input } from "reactstrap";

class Register extends Component {
  state = {
    first_name: "",
    last_name: "",
    email: "",
    password: ""
  };
  handleFirst_name = e => {
    this.setState({
      first_name: e.target.value
    });
  };
  handleLast_name = e => {
    this.setState({
      last_name: e.target.value
    });
  };
  handleEmail = e => {
    this.setState({
      email: e.target.value
    });
  };
  handlePassword = e => {
    this.setState({
      password: e.target.value
    });
  };

  render() {
    console.log(this.props);
    return (
      <div>
        <h2>Hello from Register!</h2>
        <Form className="register">
          <FormGroup>
            <Label for="exampleName" hidden>
              FirstName :
            </Label>
            <Input
              type="firstName"
              name="firstName"
              id="examplefirstName"
              placeholder="First-Name"
              onChange={this.handleFirst_name}
            />
          </FormGroup>
          <br />
          <FormGroup>
            <Label for="exampleLastName" hidden>
              LastName :
            </Label>
            <Input
              type="lastName"
              name="lastName"
              id="examplelastName"
              placeholder="Last-Name"
              onChange={this.handleLast_name}
            />
          </FormGroup>
          <br />
          <FormGroup>
            <Label for="exampleEmail" hidden>
              Email :
            </Label>
            <Input
              type="email"
              name="email"
              id="exampleEmail"
              placeholder="Email"
              onChange={this.handleEmail}
            />
          </FormGroup>{" "}
          <br />
          <FormGroup>
            <Label for="examplePassword" hidden>
              Password :
            </Label>
            <Input
              type="password"
              name="password"
              id="examplePassword"
              placeholder="password"
              onChange={this.handlePassword}
            />
          </FormGroup>
          <br />
          <Button
            className="btn1"
            onClick={() => {
              this.props.firstFunc(
                this.state.first_name,
                this.state.last_name,
                this.state.email,
                this.state.password
              );
            }}
          >
            <Link to="/render">Go to Render</Link>
          </Button>
        </Form>
      </div>

      /*    */
    );
  }
}

export default Register;
